import React from "react";
// import "../../assets/css/allQuestions.css";
import "../../assets/css/singleQuestion.css";

const SingleQuery = () => {
  return (
    <div className="allQuestions">
      <div className="d-flex justify-content-between ps-lg-4 pe-ls-5 ps-2 pe-2 flex-column flex-sm-row">
        <div className="d-flex flex-column">
          <h3 className="pt-1 questionHeader">
            What’s the best state management library for react?
          </h3>
          <div className="d-flex justify-content-between ask_view">
            <p>
              Asked <b>32 minutes ago</b>
            </p>
            <p>
              Viewed <b>3 times</b>
            </p>
          </div>
        </div>
        <div>
          <button className="query ps-3 pe-3">Ask Query</button>
        </div>
      </div>
      <div className="ps-lg-4 pe-ls-5 ps-2 pe-2 pt-4 d-flex">
        <div className="d-flex flex-column pe-sm-4 pe-3">
          <div className="hover_arrow">
            <i class="fa-solid fa-arrow-up fs-5"></i>
          </div>
          <div className="mt-2 mb-2">
            <p className="m-0 p-0 fs-5">4</p>
          </div>
          <div className="hover_arrow">
            <i class="fa-solid fa-arrow-down fs-5"></i>
          </div>
          <div className="mt-3 hover_arrow pb-4">
            <i class="fa-regular fa-bookmark fs-5"></i>
          </div>
        </div>
        <div className="d-flex flex-column justify-content-between">
          <p className="text-justify m-0 p-0">
            I have the following setup within my own WiFi network: one machine
            (A) connected to my Wifi (which connects to the internet), and one
            machine (B) running Wireshark, with a Wifi adapter in monitoring
            mode capturing packets from A. B has already deauth A (i.e.
            obtaining full handshakes). And with the WiFi password, B can fully
            decrypt all WiFi packets in and out of A, on Wireshark. I notice
            that the majority of these packets are of protocol LLC, which is for
            UDP. Now, say I log into my Gmail on A, and send out an email with a
            short text message. What would be the process to capture and
            reassemble this text message on B? Or is this objective even
            possible?
          </p>
          <div className="code-bg mt-3 p-2">
            <pre>
              {`#include <algorithm>
#include <ctime>
#include <iostream>
int main()
{
    // Generate data
    const unsigned arraySize = 32768;
    int data[arraySize];

    for (unsigned c = 0; c < arraySize; ++c)
        data[c] = std::rand() % 256;

    // !!! With this, the next loop runs faster.
    std::sort(data, data + arraySize);

    // Test
    clock_t start = clock();
    long long sum = 0;
    for (unsigned i = 0; i < 100000; ++i)
    {
        for (unsigned c = 0; c < arraySize; ++c)
        {     // Primary loop.
            if (data[c] >= 128)
                sum += data[c];
        }
    }
    double elapsedTime = static_cast<double>(clock()-start) / CLOCKS_PER_SEC;

    std::cout << elapsedTime << '\\n';
    std::cout << "sum = " << sum << '\\n';
}`}
            </pre>
          </div>
          <div className="mt-3">
            <img
              src={require("../../assets/image/code_error.png")}
              alt="CODE ERROR"
              className="img-fluid"
            />
          </div>
          <div className="d-flex mt-4 justify-content-between">
            <div className="pb-4 d-flex">
              <div className="boxSingleTag1 d-flex align-items-center">
                <p className="ps-2 pe-2 pt-1 mb-0 pb-1">django</p>
              </div>
              <div className="boxSingleTag1 d-flex align-items-center ms-2">
                <p className="ps-2 pe-2 pt-1 mb-0 pb-1">django</p>
              </div>
              <div className="boxSingleTag1 d-flex align-items-center ms-2">
                <p className="ps-2 pe-2 pt-1 mb-0 pb-1">django</p>
              </div>
            </div>
            <div className="user_box d-flex flex-column p-2">
              <p className="m-0 p-0 asked_text1">asked feb 4,2022 at 13:47</p>
              <div className="d-flex pt-1 align-items-center">
                <img
                  src={require("../../assets/image/avatarL.png")}
                  height={30}
                  alt="avatar"
                />
                <p className="m-0 p-0 user_name ps-2">Vansham</p>
              </div>
            </div>
          </div>
          {/* <div className="chatgpt mt-5 d-flex flex-column">
            <div className="d-flex ms-3 pt-3">
              <img
                src={require("../../../src/assets/image/chatgpt.png")}
                width={30}
                height={30}
                className="img-fluid"
                alt="ChatGpt Logo"
              />
              <p className="m-0 p-0 ms-2 pt-2 chatgpt_text">Chat GPT Answer</p>
            </div>
            <div>
              <pre className="ms-3 pt-2">
                {`To add two numbers in Java, you can use the "+" operator. Here is an example:

  \`\`\`java
